                nums[i] = float('inf')

        # 2. Iterate through the array and mark the numbers as present
        for i in range(len(nums)):
            num = abs(nums[i])
            if num <= len(nums):
                nums[num - 1] = -abs(nums[num - 1])

        # 3. Iterate through the array again and return the first number that is not present
