class Solution(object):
    def maxNumber(self, nums1, nums2, k):
        """
        :type nums1: List[int]
        :type nums2: List[int]
        :type k: int
        :rtype: List[int]
        """

        def pick(nums, k):
            removed = len(nums) - k
            out = []
            for num in nums:
                while removed and out and out[-1] < num:
                    out.pop()
                    removed -= 1
                out.append(num)
            return out

        def merge(nums1, nums2, k):
            merged = []
            i, j = 0, 0
            while i < len(nums1) and j < len(nums2) and len(merged) < k:
                if nums1[i] > nums2[j]:
                    merged.append(nums1[i])
                    i += 1
                else:
                    merged.append(nums2[j])
                    j += 1
            merged.extend(nums1[i:])
            merged.extend(nums2[j:])
            return merged

        def get_max_k_nums(nums1, nums2, k):
            if len(nums1) > len(nums2):
                return get_max_k_nums(nums2, nums1, k)
            if len(nums2) - len(nums1) >= k:
                return nums2
            return pick(merge(nums1, nums2, k), k)

        return get_max_k_nums(nums1, nums2, k)

